import React from 'react';


class Statement extends React.Component {
  constructor(props) {
    super();
    this.state = {
      isLoading: true,
      patients: []
    };
  }
  async componentDidMount() {
    if (!this.props.isAuthenticated) {
      return;
    }

    this.setState({ isLoading: false });
  }
  renderLander() {
    return (
      <section id="statement">
        <div class="content-box-lg">
          <div class="container">
            <div class="row">
              <div class="col-md-12 wow fadeIn">
                <div id="tech-statement" class="text-center">
                  <h3>
                    <i class="fa fa-quote-left"></i>The successful warrior is the average man, with laser-like focus..<i class="fa fa-quote-right"></i>
                  </h3>
                  <p>- Bruce Lee -</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
  render() {
    return (
      <div className="StatementDiv">
        {this.renderLander()}
      </div>
    );
  }
}

export default Statement;
